import React from "react";
import { Tabs } from "antd";
import "./Dashboard.css";

const { TabPane } = Tabs;

function Dashboard() {
  const handleTabChange = (key) => {
    console.log("Selected Tab:", key);
  };

  return (
    <div className="Dashboard">
      <Tabs defaultActiveKey="today" onChange={handleTabChange}>
        <TabPane tab="Today" key="today">
          <div className="Today-content">Today Content</div>
        </TabPane>
        <TabPane tab="Overall" key="overall">
          <div className="Overall-content">Overall Content</div>
        </TabPane>
      </Tabs>
    </div>
  );
}

export default Dashboard;
